speed: 120
horizontal_move_z: 5
mesh_min: 15,20       ## NOTE: mesh_min and mesh_max points should include probe:x/y_offset values.
mesh_max: 155,170     ##   Example: For intended nozzle coordinate 3,5 and probe:y_offset=26 probe:x_offset=0 set mesh_min: 3,31
probe_count: 9,9
#relative_reference_index: 0
algorithm: bicubic
#move_check_distance: 3
#split_delta_z: .01
#adaptive_margin: 0

